import React from 'react';
import { Link } from 'react-router-dom';
import dashboardIcon from '../assets/images/dashboard.svg';
import operationsIcon from '../assets/images/operations.svg';
import trackingIcon from '../assets/images/tracking.svg';
import reportsIcon from '../assets/images/reports.svg';
import configurationsIcon from '../assets/images/configurations.svg';
import SidebarMenuItem from './commons/SidebarMenuItem';

function SidebarMenu(props) {
  return (
    <ul className='sidebarMenu'>
      <SidebarMenuItem name='Dashboard' icon='dashboardIcon' />
      <li>
        <Link to='/'>
          <img src={dashboardIcon} alt='Dashboard' /> Dashboard
        </Link>
      </li>
      <li>
        <Link to='/operations'>
          <img src={operationsIcon} alt='Dashboard' /> Operations
        </Link>
      </li>
      <li>
        <Link to='/tracking'>
          <img src={trackingIcon} alt='Dashboard' />
          Tracking
        </Link>
      </li>
      <li>
        <Link to='/reports'>
          <img src={reportsIcon} alt='Dashboard' />
          Reports
        </Link>
      </li>
      <li>
        <Link to='/configurations'>
          <img src={configurationsIcon} alt='Configurations' />
          Configurations
        </Link>
      </li>
    </ul>
  );
}

export default SidebarMenu;
